import React from 'react';
import SetData from './SetData';

const Accordian = ()=>{
    return(
    <>
    <ul>
    {SetData.map((value,id)=>{
        return (
            <li>
            <p>{id}</p>
        <p>{value.ques}</p>
        <p>{value.ans}</p>
        </li>
        )
    })}
    </ul>
    
    </>
    );
}


export default Accordian;
